            'Content-Language' =&gt; 'en',
            'X-AppApiToken' =&gt; 'Uk1DSFlVUVhIRXpHbWt6d2pIZjlPTG15akRPN2tJTUs=',
            'X-AppType' =&gt; 'docs',
        ],
        'json' =&gt; [
            'email' =&gt; 'user@demosite.com',
            'password' =&gt; '123456',
            'auth_field' =&gt; 'email',
            'phone' =&gt; null,
            'phone_country' =&gt; null,
            'captcha_key' =&gt; 'sunt',
        ],
    ]
);
$body = $response-&gt;getBody();
print_r(json_decode((string) $body));</code></pre></div>


